import React from 'react'
import Box from './Box'
import styled from 'styled-components'

export const Ul = styled(Box)({
  padding:0,
  listStyle:'none'
})

export const Li = styled(Box)({
  paddingY: 5,
  paddingX: 10,
})


Ul.defaultProps = {
  as: 'ul'
}

Li.defaultProps = {
  as: 'li'
}
